import React from "react";

function Chat_element(user) {
    return (
        <tr>
            <tbody>
            <td>{user.id}</td>
            <td>{user.surname}</td>
            <td>{user.name}</td>
            <td>{user.patronymic}</td>
            </tbody>
        </tr>
    )
}

export default Chat_element;
